import React from "react";
import styles from "./hotList.module.css";
import { Link } from "react-router-dom";

function Header() {
  return (
    <div className={styles.mainSection}>
        <div className={styles.mainHeader}>인기 상품</div>
        <div className={styles.productContainer}>
          <div className={styles.productWrap}>
            <div className={styles.productImgDiv}>
              <img src={require("../images/hot_item1.jpg")}
              className={styles.productImg}/>
            </div>
            <h4 className={styles.productTitle}> 상품 제목</h4>
            <div className={styles.productPrice}> 15,000￦</div>
          </div>
        </div>

        <div className={styles.mainHeader}>신상품</div>
      </div>
  )
}
